      "cloudloadbalancerdata": {
        "description": "Parameters associated with a cloud load balancer.",
        "properties": {
          "attachedEntities": {
            "description": "ID of associated objects with this load balancer.",
            "example": [
              "subnet-074c152ae45ea0c73"
            ],
            "items": {
              "type": "string"
            },
            "type": "array"
          },
          "listenertargetmapping": {
            "additionalProperties": {
              "items": {
                "type": "string"
              },
              "type": "array"
            },
            "description": "Mapping of a listener to its associated target group ID list.",
            "type": "object"
          },
          "name": {
            "description": "The name of the load balancer.",
            "example": "lb-009251c49cf46d940",
            "type": "string"
          },
          "scheme": {
            "description": "The scheme tells whether the load balancer is internet facing or internal.",
            "example": "internet-facing",
            "type": "string"
          }
        },
        "type": "object"
      }
    }
  },
